.
Those words were actually said to our sons from another boy at practice.  I was in the stands when I heard this boy.  Just when I wanted to go all “Mama Bear” on this boy, I saw our oldest son, Jonathan, look that boy right in his eyes and say, “We’re brothers because we’re adopted and besides we’re brothers through God.” Then he took his brother and went to another line. Just like that!
.
Jonathan handled that with such grace and calmness.  I was amazed!  My heart was bursting with pride watching our boys walk away. 
.
We teach our sons the importance of brotherhood. It doesn’t matter if they’re adopted, they’re brothers no matter what! They always watch out for each other!  They are only 13 months apart and have a close relationship. 
.
